import './Home.css';

function Home() {
  return (
    <section className="home">
      <h2>Welcome to the Global Travel Companion</h2>

      <p>
        The Global Travel Companion (GTC) helps you prepare trips around the world.
      </p>
      <p>
        Browse supported currencies and see current exchange rates.
      </p>
      <p>Use the navigation above to switch between pages.</p>
    </section>
  );
}

export default Home;
